import React from 'react'

function Header( {text, bgColor, textColor} ) {
    const styles = {
      backgroundColor: bgColor, 
      color: textColor
    }
  return (
    <header style={styles} >
        <div className='container'>
            <h2>{text}</h2>
        </div>
    </header>
  )
}

export default Header
